import React from 'react';
import { useLocation } from 'react-router-dom';

/*Componentes */
import Buscador from '../componentes/Buscador';
import PropiedadHome from '../componentes/PropiedadHome';

/*JSONs */
import dataProps from "../data.json";

function Search(){
    const location = useLocation();

    function useQuery() {
      return new URLSearchParams(useLocation().search);
    }

    const query = useQuery();
    const search = query.get("search");
    console.log(search);

    return(
    <div>
      <br/>   
      <br/>   
      <br/>   
      <br/>   
      <br/>   
      <br/>   
      <br/>   
      <Buscador />
      <h1>
          Â¡Contamos con {dataProp.length} propiedades que te esperan!
      </h1>
      <div className='container-Propiedades'>
       {dataProps.map((dataProp) => {
            return <PropiedadHome key={dataProp.id}
            alquilada={dataProp.alquilada}
            id={dataProp.id}
            nombre={dataProp.nombre}
            direccion={dataProp.direccion}
            imagen={dataProp.imagen}
            precio={dataProp.precio}
            expensas={dataProp.expensas}
            operacion={dataProp.operacion}
            ambientes={dataProp.ambientes}
            metros={dataProp.metros}
            />
          }
        )}
      </div>
    </div>
    );
}

export default Search;
